import React, { Component } from 'react'
import { Layout } from 'antd'
import { Link } from 'react-router-dom'
import storageUtils from '../../utils/storageUtils'
import LinkButton from '../LinkButton'

const { Header } = Layout
export default class UserHead extends Component {

    logout = () => {

    }

    render() {
        const user = storageUtils.getUser()
        console.log(user)
        return (
            <div>
                <Header className="head">订票系统
                    <span style={{ marginLeft: '800px', fontSize: '15px' }}>
                        {
                            !user ? <Link to="/user/login" style={{ marginLeft: '20px' }}>登录</Link> : <span>{user.phone}<LinkButton style={{ marginLeft: '20px' }}>退出</LinkButton></span>
                        }
                    </span>
                </Header>
            </div>
        )
    }
}
